import React from "react";

function Deposit(props) {
  return props.trigger ? (
    <div>
      <h1>Deposit</h1>
      <label>Amount:</label>
      <input type="number" className="amount" name="amount" required />
      <button type="submit" onClick={() => (props.setTrigger = false)}>
        Deposit
      </button>
    </div>
  ) : (
    ""
  );
}

export default Deposit;
